import React, { useState, useEffect } from 'react';
import { useParams } from "react-router-dom";
import axios from 'axios';


function Detail(){

    const {dog} = useParams();
    const [images, setImages] = useState([]);

    useEffect(() => {
        const getDogs = async () => {
                try {
                        let mounted = true;
                        if(mounted){
                        if(dog !== ""){
                            const res = await axios.get('https://dog.ceo/api/breed/'+dog+'/images/random/4');
                            console.log("return", res.data.message);
                            setImages(res.data.message);
                            console.log(res.data.message);
                        }

                        }
                } catch (err) {

                }
                console.log('fire');
        }
        getDogs();
    },[dog]);



	return (
		<>
        DETAIL for {dog}
				<div className="container-fluid">
					<ul className="doggo-list d-flex">
							{images.map(listitem => (
								<li key={dog+Math.random()}className="dog-image"><img className="doggo" alt={dog+'image'} src={listitem	}></img></li>
							))}
					</ul>
				</div>

        <a href="/Home">Back to Search</a>
        </>
	);
}

export default Detail;
